import React from 'react'
import Navbar from '../navbar'
import Paper from '@material-ui/core/Paper';
import Container from '@material-ui/core/Container';
import './sign.css'

export default () => {
    return (
        <div className='whole_sign'>
            <Navbar/>
            <Container>
                <Paper>
                    <form>
                        <h2>Sign in</h2>
                    </form>
                </Paper>
            </Container>
        </div>

    )
}
